export default function SentiResults(props){
    console.log(props);
    return (
    <PieChart
        data={[
            { title: 'Positive', value: props.positive , color: '#E38627' },
            { title: 'Negative', value: props.negative, color: '#C13C37' },
            { title: 'Neutral', value: props.neutral, color: '#6A2135' },
        ]} radius={40} viewBoxSize={[100,100]} center={[50,50]}
    />);
}
